        '1FAIpQLSf3lZQoBjpJaOnzWid7LQ5Ntc98vMFBJNXl5hryiiagpgdoFg',
        '1FAIpQLSeiM1yS-2yS90Enyk7uSsnCTWoThULWu3InAtwgHgeiovBcAA',
    ];

    const [showForm, setShowForm] = useState(false);

    return (
        <div
            className='App'
            style={{
                height: '100vh',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                marginTop: '40px',
            }}
        >
            {!showForm && <button onClick={() => settShowForm(true)}>PRADÄ–TI</button>}
            {showForm && <ExperimentForm code={formUrls.random()} />}
        </div>
    );
}

export default App;

Array.prototype.random = function () {
    return this[Math.floor(Math.random() * this.length)];
};
